import { useState } from "react";
import ConnectCard from "../components/user/ConnectCard";

const MyNetwork = () => {
    const people = [0,2,4]
    return(
        <div className="bg-gray">
            <div className="user-network content-card bg-white br-rad">
                <div className="content-main-card flex flex-column">
                    <div className="text-align-left pd10">
                        People in linkedin
                    </div>
                    <hr className="light-hr"></hr>
                    <div className="pd-10 flex flex-wrap flex-row flex-gp10">
                        {people.map(() => (
                            <ConnectCard/>
                        ))}
                    </div>
                </div>
            </div>
        </div>
    );
}

export default MyNetwork;
